// this code will route lead in companies with more than 100 employees to 1:1 demo and other leads to group demo

// feel free to tweak this code to fit your own qualification criteria

// set default value to 2
 $input.item.json.result = 2
// initialize company_size
 company_size = 0


if ($input?.item?.json?.company_size){
company_size = $input.item.json.company_size} 

// route lead to 1:1 if company size > 100
if (company_size > 100) {
  $input.item.json.result = 1
}

return $input.item;
